import React from 'react';
import Header from './components/header/Header';

function App() {
  const privateSections = [
    { title: 'Private Section 1', url: '/private-section-1' },
    { title: 'Private Section 2', url: '/private-section-2' },
  ];

  return (
    <div>
      {/* Other components */}
      <Header privateSections={privateSections} />
      {/* Other components */}
    </div>
  );
}

export default App;
